import "./App.css";

import SampleVideo from "./sample-mp4-file.mp4";

function App() {
  // https://www.learningcontainer.com/wp-content/uploads/2020/05/sample-mp4-file.mp4
  const video = SampleVideo;

  return (
    <div className="App">
      <video controls>
        <source src={video} type="video/mp4" />
      </video>
    </div>
  );
}

export default App;
